import React from "react";
import "./App.css";
import Usuario from "./components/cadastroUsuario";
import Veiculo from "./components/cadastroVeiculo";
import Busca from "./components/buscaVeiculo";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

const callUser = () => {
  <Usuario />;
};
const callCar = () => {
  <Veiculo />;
};
const callSearch = () => {
  <Busca />;
};

function App() {
  return (
    <Router>
      <div className="App">
        <Link to={Usuario}>Usuario</Link>
        <Link to="/veiculo">Veiculo</Link>
        <Link to="/buscar">Buscar</Link>
      </div>

      <Routes>
        <Route path="/usuario" element={Usuario} />
        <Route path="/veiculo" element={Veiculo} />
        <Route path="/buscar" element={Busca} />
      </Routes>
    </Router>
  );
}

export default App;
